import './ContactMe.css';

const ContactMe = () => {
  return (
    <div className="contact-me-container">
      <h2>Contact Me</h2>
      <p>Feel free to reach out to me through the following accounts:</p>
      <div className='contact'>
        <ul>
          <li>Email: janadaribjv123@gmail.com</li>
          <li>LinkedIn: https://www.linkedin.com/in/janadari-chandramali-samarakoon-650187191</li>
        <li>GitHub: https://github.com/janadari123</li>
        </ul>
      </div>
      
    </div>
  );
};

export default ContactMe;
